# Check commutativity between stabilizers
def commutes(s1, s2):
    count = 0
    for c1, c2 in zip(s1, s2):
        if c1 != 'I' and c2 != 'I' and c1 != c2:
            count += 1
    return count % 2 == 0

print(f"Number of stabilizers: {len(stabs)}")
print(f"Stabilizer length: {len(stabs[0])}")

# Find anticommuting pairs
anticommuting = []
n = len(stabs)
for i in range(n):
    for j in range(i+1, n):
        if not commutes(stabs[i], stabs[j]):
            anticommuting.append((i, j))

print(f"Number of anticommuting pairs: {len(anticommuting)}")
if anticommuting:
    print(f"First 10 anticommuting pairs: {anticommuting[:10]}")

# Find maximal commuting subset using greedy approach
# Start with the first stabilizer, then add each that commutes with all already in the set
chosen = []
for i in range(n):
    ok = True
    for j in chosen:
        if not commutes(stabs[i], stabs[j]):
            ok = False
            break
    if ok:
        chosen.append(i)

print(f"Found {len(chosen)} commuting stabilizers")
print(f"Indices: {chosen[:20]}...")

# Generate circuit for commuting subset
subset_stabs = [stabs[i] for i in chosen]

try:
    tab = stim.Tableau.from_stabilizers(
        [stim.PauliString(s) for s in subset_stabs],
        allow_redundant=True,
        allow_underconstrained=True
    )
    print("Tableau created successfully!")
    circuit = tab.to_circuit(method="elimination")
    print(f"Circuit generated with {len(circuit)} instructions")
    
    # Save the circuit
    with open("circuit_171_v1.stim", "w") as f:
        f.write(str(circuit))
    print("Circuit saved to circuit_171_v1.stim")
    
except Exception as e:
    print(f"Error creating circuit: {e}")
